import React , { useEffect, useState } from 'react';

function Url () {
	
	const [ printUrl , setPrintUrl ] = useState();
	const api = "https://urlscan.io/api/v1/search/?q=domain:urlscan.io";

	useEffect(() => {
		fetch( api )
		.then( url => url.json() )
		.then( url => {
			
			var geturl = url.results[ 0 ];
			var laurl = {
				"dominio" : geturl.task.domain ,
				"method" : geturl.task.method ,
				"url" : geturl.task.url ,
				"uuid" : geturl.task.uuid ,
				"ip" : geturl.page.ip ,
				"server" : geturl.page.server ,
			};
			// for ( var count = 0; count <= url[ 0 ]; count++ ) {
				
			// };
			
			console.log( geturl );
			console.log( laurl.dominio );
			console.log( laurl.url );
			setPrintUrl( [laurl] );
		});
	},[]);

	return (
		<section className="url">
			<ul>
				{/* <li>Dominio: { printUrl.dominio }</li> */}
			</ul>
		</section>
	);
};

export default Url;
